private static String topLevelType(String type) {
    final String topLevelType;
    final int dotIndex = type.indexOf('.');
    if (dotIndex == -1) {
        topLevelType = type;
    }
    else {
        topLevelType = type.substring(0, dotIndex);
    }
    return topLevelType;
}
